// Models.js
import React from 'react';
import { useParams } from 'react-router-dom';
import modelsData from './models.json';
import './Models.css';

const Models = () => {
  const { seriesId } = useParams();

  // Filtrar los modelos basados en el seriesId
  const filteredModels = modelsData.models.filter(model => model.seriesId === parseInt(seriesId));

  return (
    <div className="grid-container">
      {filteredModels.length > 0 ? (
        filteredModels.map(model => (
          <div key={model.id} className="model-card">
            <h3>{model.name}</h3>
            <p>SKU: {model.sku}</p>
            <p>Description: {model.description}</p>
            {model.additionalAttribute && (
              // Obtener el nombre y el valor del atributo adicional
              Object.entries(model.additionalAttribute).map(([key, value]) => (
                <p key={key}>{key}: {value}</p>
              ))
            )}
            <a href={model.productDetailUrl} target="_blank" rel="noopener noreferrer">View Details</a>
          </div>
        ))
      ) : (
        <div>No se encontraron modelos para la serie seleccionada.</div>
      )}
    </div>
  );
};

export default Models;
